import React, { useState } from "react";
import "./AddJobDescription.css";
import JobListingimg from "../../../src/assets/job-listing2.jpg";

const AddJobDescription = () => {
  const [formData, setFormData] = useState({
    companyName: "",
    companyLogo: "",
    jobPosition: "",
    monthlySalary: "",
    jobType: "",
    remote_office: "",
    location: "",
    jobDescription: "",
    aboutCompany: "",
    skillsRequired: [],  // Now stores an array of skills
    additionalInfo: "",
    hiringCount: "",
  });

  // Handle input change
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  // Handle multiple skills selection
  const handleSkillsChange = (e) => {
    const selectedSkills = Array.from(e.target.selectedOptions, (option) => option.value);
    setFormData({ ...formData, skillsRequired: selectedSkills });
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:5000/api/jobs", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${localStorage.getItem("token")}`, // If auth required
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        alert("Job added successfully!");
        setFormData({
          companyName: "",
          companyLogo: "",
          jobPosition: "",
          monthlySalary: "",
          jobType: "",
          remote_office: "",
          location: "",
          jobDescription: "",
          aboutCompany: "",
          skillsRequired: [],
          additionalInfo: "",
          hiringCount: "",
        });
      } else {
        const errorData = await response.json();
        alert(errorData.message || "Failed to add job");
      }
    } catch (error) {
      console.error("Error submitting job:", error);
      alert("Server error, please try again later");
    }
  };

  return (
    <div className="add-job-description">
      <div className="form-container">
        <h2 className="form-heading">Add Job Description</h2>
        <form className="job-form" onSubmit={handleSubmit}>
          
          {/* Other input fields */}
          
          <div className="form-row">
            <label className="form-label">Skills Required</label>
            <select name="skillsRequired" className="form-input" multiple value={formData.skillsRequired} onChange={handleSkillsChange}>
              <option value="HTML">HTML</option>
              <option value="CSS">CSS</option>
              <option value="React.js">React.js</option>
              <option value="JavaScript">JavaScript</option>
              <option value="Node.js">Node.js</option>
              <option value="MySql">MySql</option>
              <option value="Express.js">Express.js</option>
              <option value="Rest Apis">REST APIs</option>
              <option value="MongoDB">MongoDB</option>
              <option value="TypeScript">TypeScript</option>
            </select>
            <p className="selected-skills">Selected: {formData.skillsRequired.join(", ")}</p>
          </div>

          <div className="form-buttons">
            <button type="button" className="btn-cancel" onClick={() => setFormData({})}>Cancel</button>
            <button type="submit" className="btn-add-job">+ Add Job</button>
          </div>
        </form>
      </div>

      <div className="image-container">
        <img src={JobListingimg} alt="Job Illustration" className="job-image" />
      </div>
    </div>
  );
};

export default AddJobDescription;
